import styled from "styled-components";
import {img01, img02, img03, img04, img05, img06, img07, img08, img09} from "../../../../imgs/iconsCarousel/"


function CarouselImgs() {
    return (
        <>
            <img src={img01}></img>
            <img src={img02}></img>
            <img src={img03}></img>
            <img src={img04}></img>
            <img src={img05}></img>
            <img src={img06}></img>
            <img src={img07}></img>
            <img src={img08}></img>
            <img src={img09}></img>
        </>
    )
}

export default CarouselImgs;
